webpackJsonp([0x9234eb2f4827],{449:function(a,e){a.exports={data:{markdownRemark:{html:'<p>About a year ago I attended a <a href="https://www.meetup.com/it-IT/NYC-D3-JS/events/236673854/">Meetup on D3.js</a>. The first talk by <a href="https://github.com/mdezube">Michael Dezube</a> was on using machine learning to analyze text messages and visualize the results. Today I want to walk through all the awesomeness we have in this project.</p>\n<h1 id="demo"><a href="#demo" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Demo</h1>\n<p>The first chart we see is this\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sms-analysis-1-86b3d9848a6783f0fbfcf3250110969c-4b2e7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 954px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.38574423480084%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="texting per month"\n        title=""\n        src="/static/sms-analysis-1-86b3d9848a6783f0fbfcf3250110969c-4b2e7.png"\n        srcset="/static/sms-analysis-1-86b3d9848a6783f0fbfcf3250110969c-37099.png 300w,\n/static/sms-analysis-1-86b3d9848a6783f0fbfcf3250110969c-f2478.png 600w,\n/static/sms-analysis-1-86b3d9848a6783f0fbfcf3250110969c-4b2e7.png 954w"\n        sizes="(max-width: 954px) 100vw, 954px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nHere it simply shows us our messaging habits over the years. Kinda amazing how it varies. But let\'s dive deeper. The important question really is: Who did we message? We can display the top N people:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sms-analysis-2-b326bf83fada3d7ed8d7c9ae49b8d403-2fd0b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1165px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.11158798283261%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="top people messaged with"\n        title=""\n        src="/static/sms-analysis-2-b326bf83fada3d7ed8d7c9ae49b8d403-2fd0b.png"\n        srcset="/static/sms-analysis-2-b326bf83fada3d7ed8d7c9ae49b8d403-715e4.png 300w,\n/static/sms-analysis-2-b326bf83fada3d7ed8d7c9ae49b8d403-fcbdd.png 600w,\n/static/sms-analysis-2-b326bf83fada3d7ed8d7c9ae49b8d403-2fd0b.png 1165w"\n        sizes="(max-width: 1165px) 100vw, 1165px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nBut who did we message and when?\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-2aea6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 97.59229534510433%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="people messaged over time"\n        title=""\n        src="/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-abe1c.png"\n        srcset="/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-10046.png 300w,\n/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-3c4a3.png 600w,\n/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-abe1c.png 1200w,\n/static/sms-analysis-3-10e5f2334114d2aaa588e029eb19ba12-2aea6.png 1246w"\n        sizes="(max-width: 1200px) 100vw, 1200px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nThis graph is really amazing! It\'s almost a history of my life. Looking back at it, I can see when I made friendships and how they were developing. This is probably my favorite visualization!</p>\n<p>After that we have a word cloud and a tree for visualizing conversations, but it\'s a little too personal for me to post online.</p>\n<p>Later in the Jupyter notebook we find a chart that shows us our top words over the years, accounting for the relative frequency in other years:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sms-analysis-4-2b106777dbb8e7dc4d57fbbc4ca4c12f-f77ec.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 756px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 126.71957671957672%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="words over the years"\n        title=""\n        src="/static/sms-analysis-4-2b106777dbb8e7dc4d57fbbc4ca4c12f-f77ec.png"\n        srcset="/static/sms-analysis-4-2b106777dbb8e7dc4d57fbbc4ca4c12f-f6d30.png 300w,\n/static/sms-analysis-4-2b106777dbb8e7dc4d57fbbc4ca4c12f-3b26c.png 600w,\n/static/sms-analysis-4-2b106777dbb8e7dc4d57fbbc4ca4c12f-f77ec.png 756w"\n        sizes="(max-width: 756px) 100vw, 756px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nHere we not only see me moving to the US, but also how I was interacting. The blacked out sections are names of people. Fascinating who I was talking about 😉.</p>\n<p>Lately this project has not seen any attention, but there is still so much more to explore.</p>\n<h1 id="my-contribution"><a href="#my-contribution" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>My contribution</h1>\n<p>After the presentation I was super excited about the idea and wanted to try it out. Unfortunately it only supported iPhones. So I added an Facebook Chat connector. It still has minor issues, such as an ID not being properly resolved, but it works (in fact all those charts above are based on FB).</p>\n<p>I have also been looking into clustering. Having the word vectors would allow us to cluster our text/chat partners and see who we interact with similarly. It is not done yet, but this is how a first draft looks (names purposefully omitted).\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sms-analysis-5-f645965c9d3ae51c090702637ea54822-d6fae.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 963px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 52.232606438213914%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="clustered contacts"\n        title=""\n        src="/static/sms-analysis-5-f645965c9d3ae51c090702637ea54822-d6fae.png"\n        srcset="/static/sms-analysis-5-f645965c9d3ae51c090702637ea54822-74412.png 300w,\n/static/sms-analysis-5-f645965c9d3ae51c090702637ea54822-4a056.png 600w,\n/static/sms-analysis-5-f645965c9d3ae51c090702637ea54822-d6fae.png 963w"\n        sizes="(max-width: 963px) 100vw, 963px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h1 id="check-it-out"><a href="#check-it-out" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Check it out</h1>\n<p>I\'d recommend anybody to check out the repository. Michael has been awesome in reviewing my code and gave me so many helpful tips. You can find the repository <a href="https://github.com/mdezube/sms-analysis">here</a>.</p>',timeToRead:2,excerpt:"About a year ago I attended a  Meetup on D3.js . The first talk by  Michael Dezube  was on using machine learning to analyze text messages…",frontmatter:{title:"Messaging Analysis and Visualization",cover:"/img/social-media.jpg",date:"02/14/2018",category:"Machine Learning",tags:["Programming","NLP","Visualization","Machine Learning","Past Project"]},fields:{nextTitle:"Welcome to my Blog",nextSlug:"/articles/welcome-to-my-blog",prevTitle:"Trying to build a good web app",prevSlug:"/articles/trying-to-build-a-good-web-app",slug:"/articles/messaging-analysis-and-visualization"}}},pathContext:{slug:"/articles/messaging-analysis-and-visualization"}}}});
